import { Link } from "react-router-dom";
import "./navbar.css";
import { AiOutlineHome } from "react-icons/ai";
import { AiOutlineUser } from "react-icons/ai";
import { RiServiceLine } from "react-icons/ri";

const Navbar = () => {
  return (
    <nav>
      <a href="#">
        {" "}
        <AiOutlineHome />
      </a>
      <a href="#about">
        {" "}
        <AiOutlineUser />
      </a>
      <a href="#services">
        {" "}
        <RiServiceLine />
      </a>
      <a href="#store">
        {" "}
        <AiOutlineHome />
      </a>
      <a href="#contact">
        {" "}
        <AiOutlineHome />
      </a>
    </nav>
  );
};

export default Navbar;
